-- Database: `demotron` --
-- Table `anulacion` --
CREATE TABLE `anulacion` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tipo` varchar(6) COLLATE utf8_spanish2_ci NOT NULL,
  `folio` int(11) NOT NULL,
  `motivo` text COLLATE utf8_spanish2_ci NOT NULL,
  `fecha` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;


-- Table `app_objeto` --
CREATE TABLE `app_objeto` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=latin1;


-- Table `app_permiso` --
CREATE TABLE `app_permiso` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;


-- Table `centro_costo` --
CREATE TABLE `centro_costo` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) COLLATE utf32_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;


-- Table `centro_gasto` --
CREATE TABLE `centro_gasto` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) COLLATE utf32_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;


-- Table `cheque` --
CREATE TABLE `cheque` (
  `serie` int(11) NOT NULL,
  `oc` int(11) NOT NULL,
  `fecha_emision` date NOT NULL,
  `fecha_cobro` date NOT NULL,
  `boucher` int(11) NOT NULL,
  `monto` int(11) NOT NULL,
  `estado` varchar(6) COLLATE utf8_spanish2_ci NOT NULL DEFAULT 'VALIDO',
  PRIMARY KEY (`serie`,`oc`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;




-- Table `cuota` --
CREATE TABLE `cuota` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `centro_costo` int(11) NOT NULL,
  `folio` int(11) NOT NULL,
  `valor` int(11) NOT NULL,
  `fecha` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1584 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;





-- Table `forma_pago` --
CREATE TABLE `forma_pago` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) COLLATE utf32_spanish2_ci NOT NULL,
  `div` int(11) NOT NULL,
  `dias` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;


-- Table `maquina` --
CREATE TABLE `maquina` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `equipo` int(11) NOT NULL,
  `marca` varchar(20) COLLATE utf32_spanish2_ci NOT NULL,
  `placa` varchar(10) COLLATE utf32_spanish2_ci NOT NULL,
  `codigo` varchar(10) COLLATE utf32_spanish2_ci NOT NULL,
  `modelo` varchar(50) COLLATE utf32_spanish2_ci NOT NULL,
  `anio` int(11) NOT NULL,
  `chasis` varchar(50) COLLATE utf32_spanish2_ci NOT NULL,
  `serie` varchar(50) COLLATE utf32_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=95 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;


-- Table `movimientos_oc` --
CREATE TABLE `movimientos_oc` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `inicial` int(11) NOT NULL,
  `final` int(11) NOT NULL,
  `carpeta` varchar(40) COLLATE utf32_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;


-- Table `orden_compra` --
CREATE TABLE `orden_compra` (
  `folio` int(11) NOT NULL,
  `centro_costo` int(11) NOT NULL,
  `fecha` date NOT NULL,
  `estado` varchar(20) COLLATE utf32_spanish2_ci NOT NULL,
  `proveedor` int(11) NOT NULL,
  `sol_compra` varchar(10) COLLATE utf32_spanish2_ci NOT NULL,
  `cotizacion` varchar(120) COLLATE utf32_spanish2_ci NOT NULL,
  `forma_pago` int(11) NOT NULL,
  `neto` int(11) NOT NULL,
  `iva` int(11) NOT NULL,
  `total` int(11) NOT NULL,
  `notas` text COLLATE utf32_spanish2_ci NOT NULL,
  `valores_iva` varchar(2) COLLATE utf32_spanish2_ci NOT NULL,
  `cuota_registrada` varchar(2) COLLATE utf32_spanish2_ci NOT NULL DEFAULT 'NO',
  PRIMARY KEY (`folio`)
) ENGINE=InnoDB DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;





-- Table `orden_compra_estado` --
CREATE TABLE `orden_compra_estado` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) COLLATE utf32_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;


-- Table `orden_compra_producto` --
CREATE TABLE `orden_compra_producto` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `item` int(11) NOT NULL,
  `folio` int(11) NOT NULL,
  `id_prod` varchar(150) COLLATE utf32_spanish2_ci NOT NULL,
  `cant` float NOT NULL,
  `unidad` float NOT NULL,
  `cargo` varchar(10) COLLATE utf32_spanish2_ci NOT NULL,
  `parte` varchar(30) COLLATE utf32_spanish2_ci NOT NULL,
  `valor` float NOT NULL,
  `prod_selec` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7835 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;













-- Table `origen` --
CREATE TABLE `origen` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) COLLATE utf32_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;


-- Table `producto` --
CREATE TABLE `producto` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(150) COLLATE utf32_spanish2_ci NOT NULL,
  `parte` varchar(30) COLLATE utf32_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `nombre` (`nombre`)
) ENGINE=InnoDB AUTO_INCREMENT=7271 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;










-- Table `proveedor` --
CREATE TABLE `proveedor` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `razon_social` varchar(120) COLLATE utf32_spanish2_ci NOT NULL,
  `rut` varchar(20) COLLATE utf32_spanish2_ci NOT NULL,
  `representante` text COLLATE utf32_spanish2_ci NOT NULL,
  `fono` text COLLATE utf32_spanish2_ci NOT NULL,
  `email` varchar(100) COLLATE utf32_spanish2_ci NOT NULL,
  `direccion` text COLLATE utf32_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=471 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;



-- Table `tipo_maquina` --
CREATE TABLE `tipo_maquina` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) COLLATE utf32_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;


-- Table `unidad` --
CREATE TABLE `unidad` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) COLLATE utf32_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf32 COLLATE=utf32_spanish2_ci;


-- Table `usuario` --
CREATE TABLE `usuario` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(100) NOT NULL,
  `correo` varchar(100) NOT NULL,
  `pass` varchar(30) NOT NULL,
  `origen` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `correo` (`correo`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=latin1;


-- Table `usuario_permiso` --
CREATE TABLE `usuario_permiso` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `objeto` int(11) NOT NULL,
  `usuario` int(11) NOT NULL,
  `permiso` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1097 DEFAULT CHARSET=latin1;


